import React from 'react';
import ReactDOM from 'react-dom/client';
import "./index.css";
import Card from "./Card.js";
import "tachyons";
import { cats } from "./cats"

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <div>
    <Card id={cats[0].id} name={cats[0].name}/>
    <Card id={cats[1].id} name={cats[1].name}/>
    <Card id={cats[2].id} name={cats[2].name}/>
    <Card id={cats[3].id} name={cats[3].name}/>
    </div>
);
